import React, { Component } from 'react';
import axios from 'axios';
class App extends Component {
  constructor() {
    super();
    this.state = {
      ticker: '',
    };
  } componentDidMount(){
  axios.get('https://indodax.com/api/ticker/btcidr')
  .then((ambilData) => {
    console.log(ambilData);
    this.setState({
      ticker0: ambilData.data.high,
      ticker1: ambilData.data.low,
      ticker2: ambilData.data.vol_btc,
      ticker3: ambilData.data.buy,
      ticker4: ambilData.data.sell
    }) 
  })
};
render() {
  return (
    <div>
      <center>
        <h1>Coba Get Data</h1>
        <p>{this.state.ticker0}</p>
        <p>{this.state.ticker1}</p>
        <p>{this.state.ticker2}</p>
        <p>{this.state.ticker3}</p>
        <p>{this.state.ticker4}</p>
      </center>
    </div>
  );
}
}
export default App;
